function Title(props) {
  const { name } = props;
  return (
    <div className="Title">
      <header>
        <h1>{`${props.name}'s visited places`}</h1>
        <div className="Title-Subtitle">Click to add a visitied place too see everywehre you've been!</div>
      </header>
    </div>
  )
}

